import styled from "styled-components";

export const DashboardStyled = styled.main`
  position: relative;
  .slider {
    width: 90%;
    margin: auto;
    display: flex;
  }

  .boxSlider img {
    object-fit: contain;
  }

  .slider button {
    z-index: 1;
    width: 10px;
  }
`;
